				CASE 
				WHEN tipven='DIA' AND c.`estcuo`<>'CAN' AND (DATEDIFF((SELECT (CASE WHEN fecpag IS NULL THEN CURDATE() ELSE MAX(fecpag) END) AS fecpag FROM pagocuotas WHERE idcuo=c.`idcuo`), fecven)) > 0
				THEN moncuo+moncuo*(porint/100)*DATEDIFF((SELECT (CASE WHEN fecpag IS NULL THEN CURDATE() ELSE MAX(fecpag) END) AS fecpag FROM pagocuotas WHERE idcuo=c.`idcuo`), fecven)-pagcuo
				WHEN tipven='SEM' AND c.`estcuo`<>'CAN' AND (DATEDIFF((SELECT (CASE WHEN fecpag IS NULL THEN CURDATE() ELSE MAX(fecpag) END) AS fecpag FROM pagocuotas WHERE idcuo=c.`idcuo`), fecven)) > 0
				THEN (moncuo+monint* CAST(DATEDIFF((SELECT (CASE WHEN fecpag IS NULL THEN CURDATE() ELSE MAX(fecpag) END) AS fecpag FROM pagocuotas WHERE idcuo=c.`idcuo`), fecven)/7 AS DECIMAL(10,1)))-pagcuo
				WHEN tipven='QUI' AND c.`estcuo`<>'CAN' AND (DATEDIFF((SELECT (CASE WHEN fecpag IS NULL THEN CURDATE() ELSE MAX(fecpag) END) AS fecpag FROM pagocuotas WHERE idcuo=c.`idcuo`), fecven)) > 0
				THEN moncuo+monint* CAST(DATEDIFF((SELECT (CASE WHEN fecpag IS NULL THEN CURDATE() ELSE MAX(fecpag) END) AS fecpag FROM pagocuotas WHERE idcuo=c.`idcuo`), fecven)/14 AS DECIMAL(10,1))-pagcuo
				WHEN tipven='MEN' AND c.`estcuo`<>'CAN' AND (DATEDIFF((SELECT (CASE WHEN fecpag IS NULL THEN CURDATE() ELSE MAX(fecpag) END) AS fecpag FROM pagocuotas WHERE idcuo=c.`idcuo`), fecven)) > 0
				THEN moncuo+monint* CAST(DATEDIFF((SELECT (CASE WHEN fecpag IS NULL THEN CURDATE() ELSE MAX(fecpag) END) AS fecpag FROM pagocuotas WHERE idcuo=c.`idcuo`), fecven)/30 AS DECIMAL(10,1))-pagcuo
				ELSE IF(c.`estcuo`<>'CAN',
				IF(DATEDIFF((SELECT (CASE WHEN fecpag IS NULL THEN CURDATE() ELSE MAX(fecpag) END) AS fecpag FROM pagocuotas WHERE idcuo=c.`idcuo`), fecven) > 0,
				moncuo-pagcuo+monint* CAST(DATEDIFF((SELECT (CASE WHEN fecpag IS NULL THEN CURDATE() ELSE MAX(fecpag) END) AS fecpag FROM pagocuotas WHERE idcuo=c.`idcuo`), fecven)/30 AS DECIMAL(10,1)),
				moncuo)
				,
				0) END AS UNSIGNED) AS monpag,
				
				
				CAST(CASE 
				
				WHEN tipven='DIA' AND c.`estcuo`='CAN' AND (DATEDIFF((SELECT (CASE WHEN fecpag IS NULL THEN CURDATE() ELSE MAX(fecpag) END) AS fecpag FROM pagocuotas WHERE idcuo=c.`idcuo`), fecven)) > 0
				THEN moncuo+moncuo*(porint/100)*DATEDIFF((SELECT (CASE WHEN fecpag IS NULL THEN CURDATE() ELSE MAX(fecpag) END) AS fecpag FROM pagocuotas WHERE idcuo=c.`idcuo`), fecven)-pagcuo
				WHEN tipven='SEM' AND c.`estcuo`='CAN' AND (DATEDIFF((SELECT (CASE WHEN fecpag IS NULL THEN CURDATE() ELSE MAX(fecpag) END) AS fecpag FROM pagocuotas WHERE idcuo=c.`idcuo`), fecven)) > 0
				THEN (moncuo+monint* CAST(DATEDIFF((SELECT (CASE WHEN fecpag IS NULL THEN CURDATE() ELSE MAX(fecpag) END) AS fecpag FROM pagocuotas WHERE idcuo=c.`idcuo`), fecven)/7 AS DECIMAL(10,1)))-pagcuo
				WHEN tipven='QUI' AND c.`estcuo`='CAN' AND (DATEDIFF((SELECT (CASE WHEN fecpag IS NULL THEN CURDATE() ELSE MAX(fecpag) END) AS fecpag FROM pagocuotas WHERE idcuo=c.`idcuo`), fecven)) > 0
				THEN moncuo+monint* CAST(DATEDIFF((SELECT (CASE WHEN fecpag IS NULL THEN CURDATE() ELSE MAX(fecpag) END) AS fecpag FROM pagocuotas WHERE idcuo=c.`idcuo`), fecven)/14 AS DECIMAL(10,1))-pagcuo
				WHEN tipven='MEN' AND c.`estcuo`='CAN' AND (DATEDIFF((SELECT (CASE WHEN fecpag IS NULL THEN CURDATE() ELSE MAX(fecpag) END) AS fecpag FROM pagocuotas WHERE idcuo=c.`idcuo`), fecven)) > 0
				THEN moncuo+monint* CAST(DATEDIFF((SELECT (CASE WHEN fecpag IS NULL THEN CURDATE() ELSE MAX(fecpag) END) AS fecpag FROM pagocuotas WHERE idcuo=c.`idcuo`), fecven)/30 AS DECIMAL(10,1))-pagcuo
		
				
				ELSE 0 END AS UNSIGNED) AS exonera,
				
				
				(CASE WHEN estcuo='PEN' THEN 'Pendiente' WHEN estcuo='PAR' THEN 'Pago parcial' WHEN estcuo='CAN' THEN 'Pagado' ELSE 'Pendiente' END) AS estado
			
				 
	 
					
			FROM cuotas c
			JOIN clientes cl
			ON c.`idcli`=cl.`idcli`
			where cl.idusu=idus 
			ORDER BY c.idcli,numpgr,numcuo;
			
    
    end if;
    
    END */$$
DELIMITER ;

